import React from 'react';
import '../App.css';

const LimitExceeded = (props) => {
    return(
        <div className={'limitExceeded'}>
            <h2 className={'limitExceededHead'}>Quiz Completed!</h2>
            <div className={'limitExceeded-underline'}></div>
            <h3 className={'limitExceededSubHead'}>You really did it like a <span className={'limitExceeded-ninja'}>Ninja!</span></h3>
            <div className={'pointsContainer'}>
                <span className={'pointsHead'}>Your Score</span>
                <span className={'pointsCount'}>12234</span>
            </div>
        </div>
    );
};

export default LimitExceeded;
